/*Table structure for table `sys_log` */

CREATE TABLE `sys_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '日志序列',
  `account` varchar(50) DEFAULT NULL COMMENT '账号',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `operationtime` datetime DEFAULT NULL COMMENT '操作时间',
  `content` text COMMENT '内容',
  `ip` varchar(50) DEFAULT NULL,
  `op_type` int(2) DEFAULT '2' COMMENT '0:登录 1:单纯的进入页面， 不查询数据时\\r\\n2:查询3:刪除4:添加5:修改 6 指令发送',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sys_log` */

/*Table structure for table `sys_menu` */

CREATE TABLE `sys_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `menu_name` varchar(32) NOT NULL COMMENT '关联编号',
  `menu_name_en` varchar(50) DEFAULT NULL COMMENT '菜单英文名称',
  `parent_id` int(11) DEFAULT NULL COMMENT '父级ID',
  `menu_url` varchar(256) DEFAULT NULL COMMENT '菜单URL',
  `menu_icon` varchar(50) DEFAULT NULL COMMENT '菜单图标',
  `sort_num` int(6) DEFAULT NULL COMMENT '排序号，越小越考前',
  `html_code` varchar(32) DEFAULT NULL COMMENT '页面元素标识符',
  `is_html_element` int(1) DEFAULT '1' COMMENT '是否是页面元素 1=是 2=否',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_show` int(1) DEFAULT NULL COMMENT '是否菜单显示 1=是 2=否',
  `is_delete` int(1) DEFAULT '1' COMMENT '''是否删除  1=未删除 2=删除'',',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL COMMENT '最近更新时间',
  PRIMARY KEY (`id`,`menu_name`)
) ENGINE=InnoDB AUTO_INCREMENT=248 DEFAULT CHARSET=utf8 COMMENT='菜单表';

