  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `name` varchar(50) NOT NULL COMMENT '机构名称',
  `code` varchar(50) DEFAULT NULL COMMENT '机构编码',
  `area_id` int(11) NOT NULL COMMENT '区域ID',
  `type` int(1) DEFAULT '1' COMMENT '机构类型 1 公司 2 部门',
  `level` int(1) DEFAULT '1' COMMENT '机构级别 ，1~4级',
  `parent_id` int(11) DEFAULT '0' COMMENT '上级ID，没有上级则为 0',
  `parent_ids` varchar(200) DEFAULT NULL COMMENT '所有上级ID 以逗号分隔',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `zip_code` varchar(20) DEFAULT NULL COMMENT '邮政编码',
  `master` varchar(50) DEFAULT NULL COMMENT '负责人',
  `phone` varchar(15) DEFAULT NULL COMMENT '电话',
  `fax` varchar(20) DEFAULT NULL COMMENT '传真',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `url` varchar(255) DEFAULT NULL COMMENT '网址',
  `logo_url` varchar(255) DEFAULT NULL COMMENT '机构LoGO',
  `xc_url` varchar(255) DEFAULT NULL COMMENT '宣传URL',
  `background_url` varchar(255) DEFAULT NULL COMMENT '监控背景图',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` int(1) DEFAULT '1' COMMENT '是否删除  1 未删除， 2 已删除',
  `create_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `create_by` varchar(50) DEFAULT NULL,
  `update_by` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='机构表';

