/*Table structure for table `sys_role` */

CREATE TABLE `sys_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '角色ID',
  `role_name` varchar(50) DEFAULT NULL COMMENT '关联编号',
  `office_id` int(11) DEFAULT NULL COMMENT '机构ID',
  `role_level` int(2) DEFAULT NULL COMMENT '数据粒度 1 所在部门数据  2 部门及以下数据  3 本人数据 4明细',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建者',
  `update_by` varchar(50) DEFAULT NULL COMMENT '删除者',
  `del_flag` int(11) DEFAULT '0' COMMENT '删除状态  0 未删除  1 已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8 COMMENT='角色表';

